\"simpleText\":\"New Horizons is the first mission to the Kuiper Belt, a gigantic zone of icy bodies and mysterious small objects orbiting beyond Neptune. This region also is known as the third zone of our solar system, beyond the inner rocky planets and outer gas giants.  Johns Hopkins University Applied Physics Laboratory (APL) in Maryland, designed, built and operates the New Horizons spacecraft, and manages the mission for NASAs Science Mission Directorate in Washington.   The Year of Pluto - NASA New Horizons is a one hour documentary which takes on the hard science and gives us answers to how the mission came about and why it matters. Interviews with Dr. James Green, John Spencer, Fran Bagenal, Mark Showalter and others share how New Horizons will answer many questions. New Horizons is part of the New Frontiers Program, managed by NASAs Marshall Space Flight Center in Huntsville, Alabama.\"},\"lengthSeconds\":\"3514\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/NASAtelevision\",\"externalChannelId\":\"UCLA_DiR1FfKNvjuUpBHmylQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\
